import React from 'react';

const SecondaryPage = () => {
  return (
    <div>
      <h1>Secondary Page</h1>
      <p>Welcome to the secondary page!</p>
      <p>Accessable Device list will be displayed here</p>
    </div>
  );
};

export default SecondaryPage;
